import React from "react";
import Header from "../Components/Header/Header";
import Sidebar from "../Components/Sidebar/Sidebar";
import { BrowserRouter } from "react-router-dom";
const AppRoutes = () => {
    return (
        <BrowserRouter>
            <div className="flex">
                <Sidebar />
                <div className="w-full">
                    <Header />
                </div>
            </div>
        </BrowserRouter>
    )
}
export default AppRoutes
